DROP TABLE IF EXISTS `camera_stream_proxy`;
CREATE TABLE `camera_stream_proxy`  (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT 'id',
  `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '摄像头名称',
  `node_name_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '节点信息',
  `node_ip` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT 'ip信息',
  `app` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '应用名',
  `params` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '流id',
  `stream` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '流id',
  `vhost` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '虚拟主机',
  `url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '流地址',
  `retry_count` int NULL DEFAULT NULL COMMENT '重试次数',
  `modify_stamp` int NULL DEFAULT NULL COMMENT '时间戳覆盖，不开启则没有该参数，1：绝对时间戳，2：系统时间戳，3：相对时间戳',
  `rtp_type` int NULL DEFAULT NULL COMMENT '拉流方式[0:TCP,1:UDP,2:组播]',
  `timeout_sec` int NULL DEFAULT NULL COMMENT '超时重试',
  `enable_hls` tinyint NULL DEFAULT NULL COMMENT '开启hls',
  `enable_hls_fmp4` tinyint NULL DEFAULT NULL COMMENT '开启hls-fmp4',
  `enable_mp4` tinyint NULL DEFAULT NULL COMMENT '开启MP4',
  `enable_rtsp` tinyint NULL DEFAULT NULL COMMENT '开启rtsp',
  `enable_rtmp` tinyint NULL DEFAULT NULL COMMENT '开启rtmp/flv',
  `enable_ts` tinyint NULL DEFAULT NULL COMMENT '开启ts',
  `enable_fmp4` tinyint NULL DEFAULT NULL COMMENT '开启fmp4',
  `hls_demand` tinyint NULL DEFAULT NULL COMMENT '按需生成hls',
  `rtsp_demand` tinyint NULL DEFAULT NULL COMMENT '按需生成rtsp',
  `rtmp_demand` tinyint NULL DEFAULT NULL COMMENT '按需生成rtmp',
  `ts_demand` tinyint NULL DEFAULT NULL COMMENT '按需生成ts',
  `fmp4_demand` tinyint NULL DEFAULT NULL COMMENT '按需生成fmp4',
  `enable_audio` tinyint NULL DEFAULT NULL COMMENT '开启声音',
  `add_mute_audio` tinyint NULL DEFAULT NULL COMMENT '添加静音音轨',
  `mp4_as_player` tinyint NULL DEFAULT NULL COMMENT 'MP4录制当作观看者参与播放人数计数',
  `auto_close` tinyint NULL DEFAULT NULL COMMENT '无人观看自动关闭',
  `mp4_save_path` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT 'mp4录像保存目录',
  `mp4_max_second` int NULL DEFAULT NULL COMMENT 'mp4切片大小(s)',
  `hls_save_path` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT 'hls文件保存目录',
  `node` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '对应节点',
  `deleted` tinyint NULL DEFAULT NULL COMMENT '删除标识  0：正常   1：已删除',
  `creator` bigint NULL DEFAULT NULL COMMENT '创建者',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `updater` bigint NULL DEFAULT NULL COMMENT '更新者',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `creator_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '创建人，格式：[姓名:账号]',
  `updater_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '修改人，格式：[姓名:账号]',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 4 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '摄像头拉流代理表' ROW_FORMAT = Dynamic;

