  `id` bigint NOT NULL AUTO_INCREMENT COMMENT 'id',
  `ip` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT 'mqtt IP地址（所部署的服务器的ip）',
