INSERT INTO `rules_action_instanc` VALUES (257, 'actionMap1763021890613', '{\"@type\":\"java.util.HashMap\",\"nodeName\":\"数据流转\",\"timeoutExecution\":1,\"seqExecute\":1,\"pushPlatformInformation\":[{\"@type\":\"com.alibaba.fastjson.JSONObject\",\"name\":\"Mqtt-broker(测试环境不开放端口)\",\"id\":1}],\"pushTopic\":\"1750232528537\",\"controlActionType\":3,\"userName\":\"[超级管理员:admin]\",\"userId\":1L,\"actionType\":1,\"controlType\":1,\"pushData\":\"温度大于35、湿度大于50，开启空调冷风，开启加湿器！\",\"deviceList\":[{\"@type\":\"com.alibaba.fastjson.JSONObject\",\"controlDeviceAbilityLabel\":[\"开启\"],\"controlType\":1,\"isSet\":false,\"name\":\"客厅粉色的加湿器\",\"controlDataTypeLabel\":[\"控制功能\"],\"controlAbility\":27,\"id\":41},{\"@type\":\"com.alibaba.fastjson.JSONObject\",\"controlDeviceAbilityLabel\":[\"冷风\"],\"controlType\":1,\"isSet\":false,\"name\":\"客厅白色的立式空调\",\"controlDataTypeLabel\":[\"控制功能\"],\"controlAbility\":39,\"id\":44}],\"sendType\":1,\"controlGroupId\":[]}', 15);
INSERT INTO `rules_action_instanc` VALUES (258, 'actionMap1763021890724', '{\"@type\":\"java.util.HashMap\",\"nodeName\":\"数据流转\",\"timeoutExecution\":1,\"seqExecute\":1,\"pushPlatformInformation\":[{\"@type\":\"com.alibaba.fastjson.JSONObject\",\"name\":\"Mqtt-broker(测试环境不开放端口)\",\"id\":1}],\"pushTopic\":\"1750232631469\",\"controlActionType\":3,\"userName\":\"[超级管理员:admin]\",\"userId\":1L,\"actionType\":1,\"controlType\":1,\"pushData\":\"温度小于35、湿度小于50，关闭空调冷风，关闭加湿器！\",\"deviceList\":[{\"@type\":\"com.alibaba.fastjson.JSONObject\",\"controlDeviceAbilityLabel\":[\"关闭\"],\"controlType\":1,\"isSet\":false,\"name\":\"客厅粉色的加湿器\",\"controlDataTypeLabel\":[\"控制功能\"],\"controlAbility\":28,\"id\":41},{\"@type\":\"com.alibaba.fastjson.JSONObject\",\"controlDeviceAbilityLabel\":[\"关闭\"],\"controlType\":1,\"isSet\":false,\"name\":\"客厅白色的立式空调\",\"controlDataTypeLabel\":[\"控制功能\"],\"controlAbility\":36,\"id\":44}],\"sendType\":2,\"controlGroupId\":[]}', 15);
INSERT INTO `rules_item` VALUES (15, '测试规则', 3, 'let m = seq.list();\r\nif ((deviceId == 42 && temperature > 35) && (deviceId == 42 && humidity > 50)) {\r\nlet hit = seq.map();\r\nseq.put(hit, \"actionMap\", \"actionMap1763021890613\");\r\nseq.put(hit, \"message\", \"命中条件：粉色的室内空气检测器 的 温度 > 35 与 粉色的室内空气检测器 的 湿度 > 50\");\r\nseq.add(m, hit);\r\n}\r\nif(deviceId == 42){\r\n    if(temperature < 35){\r\n    let hit = seq.map();\r\n    seq.put(hit, \"actionMap\", \"actionMap1763021890724\");\r\n    seq.put(hit, \"message\", \"命中条件：粉色的室内空气检测器 的 温度 < 35\");\r\n    seq.add(m, hit);\r\n    }\r\n}\r\nif(deviceId == 42){\r\n    if(humidity < 30){\r\n    let hit = seq.map();\r\n    seq.put(hit, \"actionMap\", \"actionMap1763021890724\");\r\n    seq.put(hit, \"message\", \"命中条件：粉色的室内空气检测器 的 湿度 < 30\");\r\n    seq.add(m, hit);\r\n    }\r\n}\r\nreturn m;\r\n', 'D:\\sana\\sana-rules\\src\\main\\resources\\script\\15.av', '当温度大于35，开启空调，开启窗帘，开启窗户！', 1, 4, 0, 1, '2025-06-18 15:37:41', 1, '2025-06-18 15:44:26', '[超级管理员:admin]', '[超级管理员:admin]');
INSERT INTO `rules_item` VALUES (16, '定时测试规则', 3, 'let m = seq.list();\r\nif ((deviceId == 43 && temperature > 40) && (deviceId == 43 && temperature > 70)) {\r\nlet hit = seq.map();\r\nseq.put(hit, \"actionMap\", \"actionMap1762222791210\");\r\nseq.put(hit, \"message\", \"命中条件：烤漆的室外空气检测器 的 温度 > 40 与 烤漆的室外空气检测器 的 温度 > 70\");\r\nseq.add(m, hit);\r\n}\r\nif ((deviceId == 43 &&  temperature < 40) && (deviceId == 43 &&  humidity < 70)) {\r\nlet hit = seq.map();\r\nseq.put(hit, \"actionMap\", \"actionMap1762222791608\");\r\nseq.put(hit, \"message\", \"命中条件： 烤漆的室外空气检测器 的 温度 < 40 与  烤漆的室外空气检测器 的 湿度 < 70\");\r\nseq.add(m, hit);\r\n}\r\nreturn m;\r\n', 'D:\\sana\\sana-rules\\src\\main\\resources\\script\\16.av', '定时监测规则', 1, 4, 0, 1, '2025-06-18 15:45:50', 1, '2025-06-18 15:54:15', '[超级管理员:admin]', '[超级管理员:admin]');
